text:
Rumor has it that the black market paid monthly salaries in hard currency yesterday, which eased pressure on the demand for usd.
Obviously this is not sustainable and we'll see lbp/usd back to the higher levels sooner than later
@lebfinance @loubnanouna1 @HuseinNourdin @dan_azzi

